script: |
  super -f text -I q11364.spq | sort > q11364.out

inputs:
  - name: q11364.spq
    data: |
      SELECT DISTINCT - 23 AS col2 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1, tab0 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q11364.out
    data: |
      -23
